    var Nav1Ad = [
      '#',
      '#micro'
    ]

    return (
      <div className="App">
        <header className="App-header">

          <Nav/>

          <p>
              This will soon be EUG
          </p>
          <a
            className="App-link"
            href="http://evogrows.com"
